window.bookSummaryJSON = "<p><b>Daphne</b></p> <p>I've always regretted not being confident enough to talk to my college crush. When he shows up during my friend's bachelorette party, I refuse to let my second chance slip through my fingers.</p> <p><b>Rob</b></p> <p>It was impossible to forget the beautiful brunette from campus. But I've always known she wasn't one-night-stand material. So I kept my distance. When she shows up years later during my brother's bachelor party, I don't know how I can possibly resist her again. There's just one problem: I don't do relationships.</p>"; 
